import React from 'react'
import { v4 as uuidv4 } from 'uuid';


// object to hold art img info in public/img/art
const ArtItems = [
  {title: "building", description: "", image: 'img/art/building.jpg'},
  {title: "coffee", description: "", image: 'img/art/coffee.jpg'},
  {title: "fallentree", description: "", image: 'img/art/fallentree.jpg'}
  // {title: "More", description: "", image: ArtDirectory + "fallentree.jpg"}
]

const Art = () => {
  return (
    <div>
      <img className='min-h-[20%]' src='img/art/ledbuilding.jpg'/>
      {ArtItems.map((artItem, i) => {
        return <img 
          key={uuidv4()}
          src={(artItem.image)}
          alt={artItem.title}
          />
      })}
    </div>
  )
}

export default Art
